import React, { useState } from "react";
import { BrowserRouter, Routes, Route } from "react-router-dom";
import ControlPanel from "./Components/ControlPanel";
import SignIn from "./Components/SignIn";
import AddFlights from './Components/AddFlight';
import SortFlight from './Components/SortFlight';
import RemoveFlight from "./Components/RemoveFlight";
import AllFlights from './Components/AllFlights';
// import style from './App.css';

function App() {

  const [flights, setFlights] = useState([]);
  console.log(flights);

  return (

    <div className="App">
      <BrowserRouter>
        <Routes>
          <Route path="/" element={<SignIn />} />
          <Route path="/ControlPanel" element={<ControlPanel flights={flights} />} />
          <Route path="/ControlPanel/AllFlights" element={<AllFlights flights={flights} setFlights={setFlights} />} />
          <Route path="/ControlPanel/SortFlights" element={<SortFlight flights={flights} setFlights={setFlights} />} />
          <Route path='/ControlPanel/AddFlights' element={<AddFlights flights={flights} setFlights={setFlights} />} />
          <Route path="/ControlPanel/RemoveFlight" element={<RemoveFlight flights={flights} setFlights={setFlights} />} />
        </Routes>
      </BrowserRouter>
    </div>
  );
}

export default App;
